name: complete-multipart-read-set-upload
description: Completes a multipart read set upload into a sequence store after you have initiated the upload process with `CreateMultipartReadSetUpload` and uploaded all read set parts using `UploadReadSetPart`.
flags:
    --cli-input-json=: Read arguments from the JSON string provided
